import { Link } from "react-router-dom";

import arrow from '../../assets/images/icons/arrow.png'

export default function PageHeader() {
  return (
    <Container>
        <Link to="/">
            <img src={arrow} alt="Back" />
            <span />
        </Link>
    </Container>
  )
}
